// frontend/src/App.js
import React, { useContext } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css'; 

// Context & Components
import AuthContext, { AuthProvider } from './context/AuthContext.js';
import AppNavbar from './components/Navbar.js';
import PrivateRoute from './utils/PrivateRoute.js';

// Pages
import HomePage from './pages/HomePage.js';
import LoginPage from './pages/LoginPage.js';
import RegisterPage from './pages/RegisterPage.js';
import OtpPage from './pages/OtpPage.js';
import UserDashboard from './pages/UserDashboard.js';
import ErranderDashboard from './pages/ErranderDashboard.js';
import BecomeErranderPage from './pages/BecomeErranderPage.js';
import AdminPage from './pages/AdminPage.js';
import ServicesPage from './pages/ServicesPage.js';
import BookingPage from './pages/BookingPage.js';
import FindErranderPage from './pages/FindErranderPage.js';

// This wrapper handles the main redirection logic
const AppWrapper = () => {
    const { user } = useContext(AuthContext);
    return (
        <Router>
            <AppNavbar />
            <main className="container-fluid p-0">
                <Routes>
                    {/* Public Route: Anyone can see the homepage ONLY IF not logged in */}
                    <Route path="/" element={!user ? <HomePage /> : <Navigate to={user.isAdmin ? "/admin" : (user.isErrander ? "/errander-dashboard" : "/dashboard")} replace />} />
                    
                    {/* Public auth routes that redirect if logged in */}
                    <Route path="/login" element={!user ? <LoginPage /> : <Navigate to="/" replace />} />
                    <Route path="/register" element={!user ? <RegisterPage /> : <Navigate to="/" replace />} />
                    <Route path="/verify-otp" element={<OtpPage />} />

                    {/* --- PROTECTED ROUTES (must be logged in) --- */}
                    <Route element={<PrivateRoute />}>
                        {/* Routes for REGULAR USERS */}
                        <Route path="/dashboard" element={<UserDashboard />} />
                        <Route path="/services" element={<ServicesPage />} />
                        <Route path="/booking/:serviceId" element={<BookingPage />} />
                        <Route path="/find-errander/:taskId" element={<FindErranderPage />} />
                        <Route path="/become-errander" element={<BecomeErranderPage />} />
                        
                        {/* Route for ERRANDERS */}
                        <Route path="/errander-dashboard" element={<ErranderDashboard />} />

                         {/* Route for ADMINS */}
                        <Route path="/admin" element={<AdminPage />} />
                    </Route>

                    {/* Fallback for any other route */}
                    <Route path="*" element={<Navigate to="/" />} />
                </Routes>
            </main>
        </Router>
    )
}

// The main App component now just provides the context
function App() {
  return (
    <AuthProvider>
        <AppWrapper />
    </AuthProvider>
  );
}

export default App;
